import './Expenseitem.css';


const Expenseitem = (props) => {

  const thatDay = new Date('05 October 2011 14:48 UTC');
  const titl = 230;
  const rate = 294.67;

  return ( 
    <div className="expense-item">
      <div className="Date">{thatDay.toISOString()}</div>
      <div className="expense-item__description">
        <h2>{}</h2>
        <div className="expense-item__price">${props.rate ? props.rate : rate}</div>
      </div>
    </div>
   );
}
export default Expenseitem;
